import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Container, Row, Col, Card, Form, Button, Alert } from 'react-bootstrap';
import './AuthBackground.css';

function Register() {
  const [strUser, setStrUser] = useState('');
  const [strEmail, setStrEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  
  const navigate = useNavigate();

  const handleRegister = async (e) => {
    e.preventDefault();
    setError('');

    if (!strUser || !strEmail || !password) {
      setError('Por favor, completa todos los campos.');
      return;
    }

    try {
      const response = await fetch('http://localhost:3111/register', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ strUser, strEmail, password }),
      });

      const data = await response.json();

      if (response.ok) {
        alert('¬°Usuario registrado con √©xito! Ahora puedes iniciar sesi√≥n.');
        navigate('/'); // Volvemos al login
      } else {
        setError(data.error || 'No se pudo completar el registro.');
      }
    } catch (error) {
      console.error('Error de red al intentar registrarse:', error);
      setError('No se pudo conectar con el servidor.');
    }
  };

  const goToLogin = () => {
    navigate('/');
  };

  return (
    <Container fluid className="d-flex align-items-center justify-content-center" style={{ minHeight: '100vh', backgroundColor: '#f8f9fa' }}>
      <Row>
        <Col>
          <Card style={{ width: '25rem' }} className="shadow-sm">
            <Card.Body className="p-4">
              <div className="text-center mb-4">
                <span style={{ fontSize: '3rem' }} role="img" aria-label="form">üìù</span>
                <h2 className="mt-2">Crear Cuenta</h2>
                <p className="text-muted">Ingresa tus datos para registrarte</p>
              </div>
              
              {error && <Alert variant="danger">{error}</Alert>}

              <Form onSubmit={handleRegister}>
                <Form.Group className="mb-3" controlId="formEmail">
                  <Form.Label>Email</Form.Label>
                  <Form.Control
                    type="email"
                    placeholder="tu@email.com"
                    value={strEmail}
                    onChange={(e) => setStrEmail(e.target.value)}
                  />
                </Form.Group>

                <Form.Group className="mb-3" controlId="formUsername">
                  <Form.Label>Usuario</Form.Label>
                  <Form.Control
                    type="text"
                    placeholder="Tu nombre de usuario"
                    value={strUser}
                    onChange={(e) => setStrUser(e.target.value)}
                  />
                </Form.Group>

                <Form.Group className="mb-3" controlId="formPassword">
                  <Form.Label>Contrase√±a</Form.Label>
                  <Form.Control
                    type="password"
                    placeholder="Crea una contrase√±a segura"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                  />
                </Form.Group>

                <Button variant="success" type="submit" className="w-100">
                  Registrarse
                </Button>
              </Form>
              
              <div className="text-center mt-3">
                <Button variant="link" onClick={goToLogin}>
                  ¬øYa tienes cuenta? Inicia Sesi√≥n
                </Button>
              </div>

            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default Register;
